import logo from './logo.svg';
import './App.css';
import React from 'react';
import ReactDOM from 'react-dom';
import './todo.css'
import GoogleMapReact from 'google-map-react';
const AnyReactComponent = ({ text }) => <div>{text}</div>;
class Todo extends React.Component {
    constructor(props) {
      super(props);
      this.state = { seconds: 0 };
    }

    tick() {
      this.setState(state => ({
        seconds: state.seconds + 1
      }));
    }

    static defaultProps = {
      center: {
        lat: 59.95,
        lng: 30.33
      },
      zoom: 11
    };


    componentDidMount() {
      this.interval = setInterval(() => this.tick(), 1000);
    }

    componentWillUnmount() {
      clearInterval(this.interval);
    }
  //AIzaSyCFp38LVqYWhNwqZlnXHzFGW0AB3iTPyxg
    render() {
      return (
        <div className='Container'>
          <script>

          </script>
          <div className='Header' >
            {/* <img src='images/background.JPG' alt='background'></img> */}
            <div className='linkTable'>
              <a href="#" className='linkText'>Link 1</a>
              <a href="#" className='linkText'>Link 2</a>
              <a href="#" className='linkText'>Link 3</a>
            </div>
          </div>
          <div className='outer'>
            <div className='card'>
            </div>
            <div className='card'>
            </div>
            <div className='card'>
            </div>
          </div>
          <div className='middle'>
              <div className='medView'>
                <div className='innerView'>

                </div>
              </div>
          </div>
          <div className='footer'>
              <GoogleMapReact
              bootstrapURLKeys={{ key: "AIzaSyCXtRiQWrsZFM6aI0EdLMwkaCCjTCs5Qd4" }}
              defaultCenter={this.props.center}
              defaultZoom={this.props.zoom}
            >
              <AnyReactComponent
                lat={59.955413}
                lng={30.337844}
                text="My Marker"
              />
            </GoogleMapReact>
          </div>
        </div>
      );
    }
  }

export default Todo;
